apiVersion: v1
binaryData:
  .DS_Store: 
  db.sqlite3: 
data:
  .gitignore: |
    # Video files
    *.mp4

    # Byte-compiled / optimized / DLL files
    __pycache__/
    *.py[cod]
    *$py.class

    # C extensions
    *.so
    # Ignore settings file
    resumechall/settings.py

    #Docker Compose file
    docker-compose.yml

    # Distribution / packaging
    .Python
    build/
    develop-eggs/
    dist/
    downloads/
    eggs/
    .eggs/
    lib/
    lib64/
    parts/
    sdist/
    var/
    wheels/
    share/python-wheels/
    *.egg-info/
    .installed.cfg
    *.egg
    MANIFEST

    # PyInstaller
    #  Usually these files are written by a python script from a template
    #  before PyInstaller builds the exe, so as to inject date/other infos into it.
    *.manifest
    *.spec

    # Installer logs
    pip-log.txt
    pip-delete-this-directory.txt

    # Unit test / coverage reports
    htmlcov/
    .tox/
    .nox/
    .coverage
    .coverage.*
    .cache
    nosetests.xml
    coverage.xml
    *.cover
    *.py,cover
    .hypothesis/
    .pytest_cache/
    cover/

    # Translations
    *.mo
    *.pot

    # Django stuff:
    *.log
    local_settings.py
    db.sqlite3
    db.sqlite3-journal

    # Flask stuff:
    instance/
    .webassets-cache

    # Scrapy stuff:
    .scrapy

    # Sphinx documentation
    docs/_build/

    # PyBuilder
    .pybuilder/
    target/

    # Jupyter Notebook
    .ipynb_checkpoints

    # IPython
    profile_default/
    ipython_config.py

    # pyenv
    #   For a library or package, you might want to ignore these files since the code is
    #   intended to run in multiple environments; otherwise, check them in:
    # .python-version

    # pipenv
    #   According to pypa/pipenv#598, it is recommended to include Pipfile.lock in version control.
    #   However, in case of collaboration, if having platform-specific dependencies or dependencies
    #   having no cross-platform support, pipenv may install dependencies that don't work, or not
    #   install all needed dependencies.
    #Pipfile.lock

    # poetry
    #   Similar to Pipfile.lock, it is generally recommended to include poetry.lock in version control.
    #   This is especially recommended for binary packages to ensure reproducibility, and is more
    #   commonly ignored for libraries.
    #   https://python-poetry.org/docs/basic-usage/#commit-your-poetrylock-file-to-version-control
    #poetry.lock

    # pdm
    #   Similar to Pipfile.lock, it is generally recommended to include pdm.lock in version control.
    #pdm.lock
    #   pdm stores project-wide configurations in .pdm.toml, but it is recommended to not include it
    #   in version control.
    #   https://pdm.fming.dev/latest/usage/project/#working-with-version-control
    .pdm.toml
    .pdm-python
    .pdm-build/

    # PEP 582; used by e.g. github.com/David-OConnor/pyflow and github.com/pdm-project/pdm
    __pypackages__/

    # Celery stuff
    celerybeat-schedule
    celerybeat.pid

    # SageMath parsed files
    *.sage.py

    # Environments
    .env
    .venv
    env/
    venv/
    ENV/
    env.bak/
    venv.bak/
    resumevenv/

    # Spyder project settings
    .spyderproject
    .spyproject

    # Rope project settings
    .ropeproject

    # mkdocs documentation
    /site

    # mypy
    .mypy_cache/
    .dmypy.json
    dmypy.json

    # Pyre type checker
    .pyre/

    # pytype static type analyzer
    .pytype/

    # Cython debug symbols
    cython_debug/

    # PyCharm
    #  JetBrains specific template is maintained in a separate JetBrains.gitignore that can
    #  be found at https://github.com/github/gitignore/blob/main/Global/JetBrains.gitignore
    #  and can be added to the global gitignore or merged into this file.  For a more nuclear
    #  option (not recommended) you can uncomment the following to ignore the entire idea folder.
    #.idea/
  Dockerfile: |
    FROM python:3.12.6-slim AS production

    # Install system dependencies required for building Postgres and website packages
    RUN apt-get update && apt-get install -y \
        gcc \
        python3-dev \
        libpq-dev \
        build-essential \
        zlib1g-dev \
        bash \
        libffi-dev \
        openssl \
        libpq-dev \
        musl-dev \
        postgresql \
    #    python-django-extensions \
        && rm -rf /var/lib/apt/lists/*

    ENV PYTHONUNBUFFERED=1
    WORKDIR /app/

    COPY requirements/prod.txt ./requirements/prod.txt
    RUN pip install --no-cache-dir -r requirements/prod.txt

    COPY manage.py  ./manage.py
    COPY setup.cfg ./setup.cfg
    COPY resumevenv ./resumevenv
    COPY resumechall ./resumechall
    COPY . .
    COPY Makefile ./Makefile

    EXPOSE 8000


    FROM production AS development

    #RUN pip install --upgrade pip setuptools wheel
    COPY requirements/prod.txt ./requirements/prod.txt
    COPY requirements/dev.txt ./requirements/dev.txt
    RUN pip install --no-cache-dir -r requirements/dev.txt
    #RUN pip install --no-cache-dir -r requirements/prod.txt

    COPY . .
  Makefile: |-
    tag=tatest
    registry=blacktonystark
    image=resumechallenge


    build:
    	docker build --force-rm $(options) -t resumechallenge:latest .

    build-prod:
    	$(MAKE) build options="--target production"

    compose-start:
    	docker-compose up --remove-orphans $(options)

    push:
    	docker tag $(image):latest $(registry)/$(image):$(tag)
    	docker push $(registry)/$(image):$(tag)

    compose-stop:
    	docker-compose down --remove-orphans $(options)

    compose-manage:
    	docker-compose run --rm web python manage.py $(cmd)

    start-server:
    	python manage.py runserver 0.0.0.0:80

    	
  docker-compose.yml: |2
    x-service-volumes: &service-volumes
      - .:/app/:rw,cached

    x-database-variables: &database-variables
      POSTGRES_DB: postgres
      POSTGRES_USER: postgres
      POSTGRES_PASSWORD: postgres

    x-app-variables: &app-variables
      <<: *database-variables
      POSTGRES_HOST: postgres




    services:
      web:
        image: resumechallenge:latest
        container_name: AWSresumechallenge
        command: python manage.py runserver 0.0.0.0:8000
        volumes: *service-volumes
        environment: *app-variables
        depends_on:
          - db_migration
        ports:
          - "8000:8000"
      db_migration:
        image: resumechallenge:latest
        command: python manage.py migrate
        volumes: *service-volumes
        environment: *app-variables
        depends_on:
          - postgres

      postgres:
        image: postgres:latest
        container_name: postgres_server
        environment: *database-variables
        ports:
          - "5432:5432"
        volumes:
          - db-data:/var/lib/postgresql/data

    volumes:
      db-data:
    #  driver: local
  manage.py: |
    #!/usr/bin/env python
    """Django's command-line utility for administrative tasks."""
    import os
    import sys

    def main():
        """Run administrative tasks."""
        os.environ.setdefault("DJANGO_SETTINGS_MODULE", "resumechall.settings")
        try:
            from django.core.management import execute_from_command_line
        except ImportError as exc:
            raise ImportError(
                "Couldn't import Django. Are you sure it's installed and "
                "available on your PYTHONPATH environment variable? Did you "
                "forget to activate a virtual environment?"
            ) from exc
        execute_from_command_line(sys.argv)


    if __name__ == "__main__":
        main()
  setup.cfg: |-
    [mypy]
    python_version = 3.12.6
    ignore_missing_imports = True
kind: ConfigMap
metadata:
  labels:
    io.kompose.service: db-migration
  name: db-migration-cm0
